import React from 'react';
import Modal from 'react-bootstrap/Modal'
import Carousel from 'react-bootstrap/Carousel'
import '../index.css'

import Menorahsauraus_1 from '../Assets/Crafts/Menorahsauraus.jpeg'
import Menorahsauraus_2 from '../Assets/Crafts/Menorahsauraus_lit.jpeg'
import Window_Wide from '../Assets/Crafts/Window_Wide.jpg'
import Window_Close from '../Assets/Crafts/Window_Close.jpg'
import Frank_1 from '../Assets/Crafts/Frank_1.jpg'
import Frank_3 from '../Assets/Crafts/Frank_3.jpg'
import Frank_4 from '../Assets/Crafts/Frank_4.jpg'
import Frank_5 from '../Assets/Crafts/Frank_5.jpg'
import Frank_6 from '../Assets/Crafts/Frank_6.jpg'
import Frank_7 from '../Assets/Crafts/Frank_7.jpg'
import Frank_8 from '../Assets/Crafts/Frank_8.jpg'
import Candy_Store_1 from '../Assets/Crafts/Candy_Store_1.jpeg'
import Candy_Store_2 from '../Assets/Crafts/Candy_Store_2.jpeg'
import Candy_Store_3 from '../Assets/Crafts/Candy_Store_3.jpeg'
import Candy_Store_4 from '../Assets/Crafts/Candy_Store_4.jpeg'
import Candy_Store_5 from '../Assets/Crafts/Candy_Store_5.jpeg'
import Candy_Store_6 from '../Assets/Crafts/Candy_Store_6.jpeg'

const menorahsauraus = [Menorahsauraus_1, Menorahsauraus_2]

const window = [{photo: Window_Wide, caption: `My office didn't have a window, so I made one!`}, {photo: Window_Close}]

const frank = [{photo: Frank_1, caption: '18 Inch Knitted Frank-N-Furter from Rocky Horror Picture Show'}, {photo: Frank_3, caption: 'All the pins and patches on the jacket match the ones from his jacket in the film.'}, {photo: Frank_4, caption: 'All the pins and patches on the jacket match the ones from his jacket in the film.'}, {photo: Frank_5, caption: 'All the pins and patches on the jacket match the ones from his jacket in the film.'}, {photo: Frank_6, caption: 'All the pins and patches on the jacket match the ones from his jacket in the film.'}, {photo: Frank_7, caption: 'Everybody needs glittery black heels.'}, {photo: Frank_8, caption: 'One Boss Bitch.'}]

const candy_store = [Candy_Store_1, Candy_Store_2, Candy_Store_3, Candy_Store_4, Candy_Store_5, Candy_Store_6]

const Crafts = () => {
    return (
        <div>

            <Carousel interval={false} slide={false} wrap={false}>
                {menorahsauraus.map((menorahsauraus, i) => {
                    return <Carousel.Item>
                        <img
                            src={menorahsauraus}
                            alt="Menorahsauraus"
                            className="thumbnail"
                            key={i}
                            />
                    </Carousel.Item>
                })}
            </Carousel>
            <Carousel interval={false} slide={false} wrap={false}>
                {window.map((window, i) => {
                    return <Carousel.Item>
                        <img
                            src={window.photo}
                            alt="Window"
                            className="thumbnail"
                            key={i}
                            />
                            <Carousel.Caption>
                                <p>{window.caption}</p>
                            </Carousel.Caption>
                    </Carousel.Item>
                })}
            </Carousel>
            <Carousel interval={false} slide={false} wrap={false}>
                {frank.map((frank, i) => {
                    return <Carousel.Item>
                        <img
                            src={frank.photo}
                            alt="Frank-n-furter"
                            className="thumbnail"
                            key={i}
                            />
                        <Carousel.Caption>
                            <p>{frank.caption}</p>
                        </Carousel.Caption>
                    </Carousel.Item>

                })}
            </Carousel>
            <Carousel interval={false} slide={false} wrap={false}>
                {candy_store.map((store, i) => {
                    return <Carousel.Item>
                        <img
                            src={store}
                            alt="Candy store"
                            className="thumbnail"
                            key={i}
                            />
                    </Carousel.Item>
                })}
            </Carousel>
        </div>

    )
}
export default Crafts;
